import React, { Fragment } from "react";

// import styles
import s from "../../styles/channelHeader.module.css";

const channelHeader = () => {
  return (
    <Fragment>
      <div className={s.channelHeaderContainer}>
        <div className={s.channelLogo}>
          <img
            src="http://placeholder.pics/svg/150/DEDEDE/555555/Channel%20Logo"
            className="img-fluid"
            width="150"
          />
        </div>
        <div className={s.channelName}></div>
        <div className={s.channelJoinNow}></div>
      </div>
    </Fragment>
  );
};

export default channelHeader;
